import React, { useState, useEffect } from 'react';
import TravelPlan from './components/TravelPlan';
import GuessNumberGame from './components/GuessNumberGame';
import Game2048 from './components/Game2048';
import SnakeGame from './components/SnakeGame';
import ClockWeatherWidget from './components/ClockWeatherWidget';
import RealEstateInfo from './components/RealEstateInfo';
import './components/RealEstateInfo.css';

import './App.css';

function App() {
  // ç™»å½•çŠ¶æ€ç®¡ç†
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isGuest, setIsGuest] = useState(true);
  const [showLoginModal, setShowLoginModal] = useState(false);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  // ä»»åŠ¡åˆ—è¡¨çŠ¶æ€
  const [tasks, setTasks] = useState([]);
  const [inputValue, setInputValue] = useState('');
  const [completedTasks, setCompletedTasks] = useState([]);
  const [showHistory, setShowHistory] = useState(false);

  // é¡µé¢çŠ¶æ€ - å°†æ—…æ¸¸è®¡åˆ’è®¾ç½®ä¸ºé¦–é¡µé»˜è®¤å±•ç¤º
  const [activePage, setActivePage] = useState('travel');

  // æ¸¸æˆçŠ¶æ€
  const [selectedGame, setSelectedGame] = useState(null);

  // ç¬‘è¯åˆ—è¡¨çŠ¶æ€
  const [jokes, setJokes] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const jokesPerPage = 10;

  // åˆå§‹åŒ–ä»»åŠ¡åˆ—è¡¨å’Œå·²å®Œæˆä»»åŠ¡
  useEffect(() => {
    const savedTasks = localStorage.getItem('tasks');
    const savedCompletedTasks = localStorage.getItem('completedTasks');

    if (savedTasks) {
      setTasks(JSON.parse(savedTasks));
    }

    if (savedCompletedTasks) {
      setCompletedTasks(JSON.parse(savedCompletedTasks));
    }
  }, []);

  // ä¿å­˜ä»»åŠ¡åˆ—è¡¨å’Œå·²å®Œæˆä»»åŠ¡åˆ°æœ¬åœ°å­˜å‚¨
  useEffect(() => {
    localStorage.setItem('tasks', JSON.stringify(tasks));
  }, [tasks]);

  useEffect(() => {
    localStorage.setItem('completedTasks', JSON.stringify(completedTasks));
  }, [completedTasks]);

  // æ·»åŠ ä»»åŠ¡
  const handleAddTask = () => {
    if (inputValue.trim() !== '') {
      const newTask = {
        id: Date.now(),
        text: inputValue.trim(),
        timestamp: new Date().toISOString()
      };
      setTasks([...tasks, newTask]);
      setInputValue('');
    }
  };

  // å¤„ç†è¾“å…¥æ¡†å›žè½¦äº‹ä»¶
  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      handleAddTask();
    }
  };

  // å®Œæˆä»»åŠ¡
  const handleCompleteTask = (id) => {
    const taskToComplete = tasks.find(task => task.id === id);
    if (taskToComplete) {
      setCompletedTasks([...completedTasks, {
        ...taskToComplete,
        completedAt: new Date().toISOString()
      }]);
      setTasks(tasks.filter(task => task.id !== id));
    }
  };

  // åˆ é™¤ä»»åŠ¡
  const handleDeleteTask = (id) => {
    setTasks(tasks.filter(task => task.id !== id));
  };

  // ä»ŽåŽ†å²è®°å½•ä¸­æ¢å¤ä»»åŠ¡
  const handleRestoreTask = (id) => {
    const taskToRestore = completedTasks.find(task => task.id === id);
    if (taskToRestore) {
      setTasks([...tasks, {
        id: Date.now(), // ç”Ÿæˆæ–°çš„IDä»¥é¿å…å†²çª
        text: taskToRestore.text,
        timestamp: new Date().toISOString()
      }]);
      setCompletedTasks(completedTasks.filter(task => task.id !== id));
    }
  };

  // ç™»å½•å¤„ç†
  const handleLogin = (e) => {
    e.preventDefault();

    // ç®€å•çš„ç™»å½•éªŒè¯é€»è¾‘ï¼ˆå®žé™…é¡¹ç›®ä¸­åº”è¯¥è¿žæŽ¥åˆ°åŽç«¯APIï¼‰
    if (email && password) {
      setIsLoggedIn(true);
      setIsGuest(false);
      setShowLoginModal(false);
      setEmail('');
